import 
{ 
  useEffect, 
  useState 
} from 'react';
import { useNavigate } from 'react-router-dom';
import axios from '../../api/axios';
import 
{
  Paper,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Typography,
  CircularProgress,
  Alert,
  Button
} from '@mui/material';
export default function OrdersPage() 
{
  const navigate = useNavigate();
  const [orders, setOrders] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  useEffect(() => 
  {
    const fetchOrders = async () => 
    {
      setError(null);
      try 
      {
        const res = await axios.get('/orders/myorders');
        setOrders(res.data);
      }
      catch (err) 
      {
        setError('Failed to fetch orders: ' + (err.response?.data?.message || err.message));
      }
      finally 
      {
        setLoading(false);
      }
    };
    fetchOrders();
  }, []);

  const handlePlaceOrder = () => {
    navigate('/CreateOrder');
  };

  if (loading) return <CircularProgress style={{ display: 'block', margin: 'auto', marginTop: 40 }} />;

  if (error) return <Alert severity="error" style={{ marginTop: 20 }}>{error}</Alert>;

  return (
    <Paper elevation={3} style={{ padding: 20, marginTop: 40 }}>
      <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
        <Typography variant="h6" gutterBottom>
          My Orders
        </Typography>
        <Button variant="contained" color="primary" onClick={handlePlaceOrder}>
          Place New Order
        </Button>
      </div>

      <TableContainer>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>Order ID</TableCell>
              <TableCell>Symbol</TableCell>
              <TableCell>Quantity</TableCell>
              <TableCell>Type</TableCell>
              <TableCell>Price</TableCell>
              <TableCell>Date</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {orders.map(order => (
              <TableRow key={order.id}>
                <TableCell>{order.id}</TableCell>
                <TableCell>{order.stock_symbol}</TableCell> {/* use stock_symbol */}
                <TableCell>{order.quantity}</TableCell>
                <TableCell>{order.order_type}</TableCell>  {/* use order_type */}
                <TableCell>{order.order_price}</TableCell>  {/* use order_price */}
                <TableCell>
                  {order.created_at ? new Date(order.created_at).toLocaleString() : 'N/A'}
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </Paper>
  );
}
